import { useState, useCallback } from 'react'; 
import { useNavigate, Link } from "react-router-dom"; 

export default function Home() { 
    return ( 
        <> 
        <div className='main'> 
            <NavBar/> 
            <Welcome/> 
        </div> 
        </>); 
} 

function Welcome(){ 
    return (
        <div className='welc'> 
            <div className='side_by_side'> 
                <div className='moto'> 
                    <h1>Welcome to ImageCloud!</h1> 
                    <h3>A simple solution to take and store your pictures to the cloud and access them anywhere. Available on the website and on Android. Create an account or login to start.</h3>
                </div>
                <div className='welc_images'> 
                    <img src='home.png'/> 
                </div>
            </div> 
        </div>
    ); 
}

export function NavBar(){ 
    const navigate = useNavigate(); 

    function handleNavClick(index){ 
        console.log(index); 
        if (index==1){ 
            navigate('/'); 
        } else if (index==2){ 
            navigate('/gallery'); 
        } else if (index==3){ 
            navigate('/login')
        } else if (index==4){ 
            navigate('/login');  
        }
    }
    return(
        <nav className='navbar'> 
            <div className='nav_button_container'> 
                <button onClick={()=>handleNavClick(1)}>Home</button> 
                <button onClick={()=>handleNavClick(2)}>Gallery</button> 
                <button onClick={()=>handleNavClick(3)}>Create Account</button> 
                <button onClick={()=>handleNavClick(4)}>Login</button> 
            </div>
        </nav>
    ); 
}
